          max-width: 1200px;
          width: 100%;
          padding: 0 20px;
        }

        .about-content {
          display: grid;
          grid-template-columns: 1fr 1fr;
          gap: 80px;
          align-items: start;
        }

        .about-title {
          font-family: 'Poppins', sans-serif;
          font-size: 48px;
