          content: '';
          position: absolute;
          bottom: -10px;
          left: 0;
          width: 60px;
          height: 4px;
          background: ${theme === 'dark' ? '#e3e5e6' : '#000000'};
          border-radius: 2px;
        }

        .bio-content {
          display: flex;
          flex-direction: column;
          gap: 24px;
        }

        .bio-text {
          font-family: 'Inter', sans-serif;
          font-size: 18px;
          line-height: 1.7;
          color: ${theme === 'dark' ? '#e3e5e6' : '#374151'};
          opacity: 0.9;
        }

        .about-image {
          display: flex;
          justify-content: center;
          align-items: center;
        }

        .image-container {
          width: 100%;
          max-width: 450px;
          aspect-ratio: 1;
          border-radius: 30px;
          overflow: hidden;
          position: relative;
          box-shadow: 
            0 25px 50px ${theme === 'dark' ? 'rgba(0, 0, 0, 0.4)' : 'rgba(0, 0, 0, 0.15)'},
            0 0 0 1px ${theme === 'dark' ? 'rgba(227, 229, 230, 0.1)' : 'rgba(0, 0, 0, 0.05)'};
          transition: all 0.4s cubic-bezier(0.4, 0, 0.2, 1);
          background: ${theme === 'dark' ? 'linear-gradient(135deg, rgba(227, 229, 230, 0.05), rgba(227, 229, 230, 0.02))' : 'linear-gradient(135deg, rgba(0, 0, 0, 0.05), rgba(0, 0, 0, 0.02))'};
        }

        .image-container::before {
          content: '';
          position: absolute;
          top: -2px;
          left: -2px;
          right: -2px;
          bottom: -2px;
          background: ${theme === 'dark' ? 'linear-gradient(45deg, #e3e5e6, #ffffff, #e3e5e6, #ffffff)' : 'linear-gradient(45deg, #000000, #374151, #000000, #374151)'};
          border-radius: 32px;
          z-index: -1;
          opacity: 0;
          transition: opacity 0.3s ease;
        }

        .image-container:hover {
          transform: translateY(-8px) scale(1.02);
          box-shadow: 
            0 35px 70px ${theme === 'dark' ? 'rgba(0, 0, 0, 0.5)' : 'rgba(0, 0, 0, 0.2)'},
            0 0 0 1px ${theme === 'dark' ? 'rgba(227, 229, 230, 0.2)' : 'rgba(0, 0, 0, 0.1)'};
        }

        .image-container:hover::before {
          opacity: 0.3;
        }

        .profile-image {
          width: 100%;
          height: 100%;
          object-fit: cover;
          object-position: center;
          transition: transform 0.4s ease;
        }

        .image-container:hover .profile-image {
          transform: scale(1.05);
        }

        @media (max-width: 1024px) {
          .about-content {
            grid-template-columns: 1fr;
            gap: 60px;
            text-align: center;
          }

          .about-title {
            font-size: 42px;
          }

          .about-title::after {
            left: 50%;
            transform: translateX(-50%);
          }

          .image-container {
            max-width: 360px;
          }
        }

        @media (max-width: 768px) {
          .about-section {
            padding: 80px 0;
          }

          .about-container {
            padding: 0 15px;
          }

          .about-content {
            gap: 40px;
          }

          .about-title {
            font-size: 36px;
            margin-bottom: 30px;
          }

          .bio-text {
            font-size: 16px;
            line-height: 1.6;
          }

          .image-container {
            max-width: 320px;
          }
        }

        @media (max-width: 480px) {
          .about-title {
            font-size: 28px;
          }

          .bio-text {
            font-size: 15px;
          }

          .image-container {
            max-width: 300px;
          }
        }
      `}</style>
    </section>
  );
};

export default About;
